INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (1, 'Oh, you sweet summer child...', 'josie', '2021-03-08 11:44:54', '2021-03-08 11:52:52');
INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (2, 'Bless your heart.', 'josie', '2021-03-08 11:51:08', '2021-03-08 11:52:54');
INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (3, 'What is that smell? Have you been cleaning fish?', 'josie', '2021-03-08 11:51:46', '2021-03-08 11:52:57');
INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (4, 'Hello Warrior of....what was it again?', 'josie', '2021-03-08 11:51:59', '2021-03-08 11:52:59');
INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (5, 'And you are...?', 'josie', '2021-03-08 11:52:22', '2021-03-08 11:53:02');
INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (6, 'Run along, now.', 'josie', '2021-03-08 11:52:45', '2021-03-08 11:55:27');
INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (7, 'Outstanding performance. Is my bath ready?', 'josie', '2021-03-08 11:53:26', '2021-03-08 11:55:42');
INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (8, 'Bhahahahahahahaha', 'josie', '2021-03-08 11:53:42', '2021-03-08 11:53:42');
INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (9, 'Outstanding performance, as to be expected from my pupil.', 'josie', '2021-03-08 11:53:53', '2021-03-08 11:53:53');
INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (10, 'You have failed me for the last time.', 'josie', '2021-03-08 11:54:06', '2021-03-08 11:55:51');
INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (11, 'Wait, what? And who are you again?', 'josie', '2021-03-08 11:54:21', '2021-03-08 11:54:21');
INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (12, 'Today\'s lesson, fetch me over 9000 comms!', 'josie', '2021-03-08 11:54:38', '2021-03-08 11:54:38');
INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (13, 'Welp, you zigged when you should have zagged.', 'josie', '2021-03-08 11:54:51', '2021-03-08 11:55:59');
INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (14, 'This borders on stalking...', 'josie', '2021-03-08 11:55:04', '2021-03-08 11:55:05');
INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (15, 'Will this take very long?', 'josie', '2021-03-08 11:56:15', '2021-03-08 11:56:16');
INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (16, 'I\'ve really got a lot to do today.', 'josie', '2021-03-08 11:56:45', '2021-03-08 11:56:45');
INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (17, 'How did you get in here? Guards!', 'josie', '2021-03-08 11:56:56', '2021-03-08 11:56:56');
INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (18, 'This again?', 'josie', '2021-03-08 11:57:11', '2021-03-08 11:57:12');
INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (19, 'For the nth time, no I will not go out with you!', 'josie', '2021-03-08 11:57:24', '2021-03-08 11:57:24');
INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (20, 'Do I look like the kind of woman who has time to chit-chat with the rabble?', 'josie', '2021-03-08 11:57:38', '2021-03-08 11:57:38');
INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (21, 'I ought to have you arrested.', 'josie', '2021-03-08 11:57:54', '2021-03-08 11:57:54');
INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (22, 'We\'ve been through this. My answer hasn\'t changed.', 'josie', '2021-03-08 11:58:14', '2021-03-08 11:58:15');
INSERT INTO `notice_me` (`id`, `reply`, `added_by`, `added_on`, `updated_on`) VALUES (23, 'If only you were taller...', 'josie', '2021-03-08 11:58:32', '2021-03-08 11:58:32');
